import React, { useEffect, useState } from "react";
import axios from "axios";

const Cart = () => {
  const [cartItems, setCartItems] = useState([]); // State to hold cart items
  const [isLoading, setIsLoading] = useState(true); // Loading state

  const userId = sessionStorage.getItem("user_id"); // Retrieve user ID from session storage

  const fetchCartItems = async () => {
    try {
      const response = await axios.get(
        `http://localhost:8000/medical_store_app/cart/${userId}`
      );
      setCartItems(response.data);
      setIsLoading(false);
    } catch (error) {
      console.error("Error fetching cart items:", error);
    }
  };

  const handleIncrement = async (itemId) => {
    try {
      await axios.post(
        `http://localhost:8000/medical_store_app/cart/increment/${itemId}`
      );
      setCartItems((prevItems) =>
        prevItems.map((item) =>
          item.id === itemId
            ? { ...item, quantity: item.quantity + 1 }
            : item
        )
      );
    } catch (error) {
      console.error("Error incrementing quantity:", error);
    }
  };

  const handleDecrement = async (itemId) => {
    try {
      await axios.post(
        `http://localhost:8000/medical_store_app/cart/decrement/${itemId}`
      );
      setCartItems((prevItems) =>
        prevItems.map((item) =>
          item.id === itemId && item.quantity > 1
            ? { ...item, quantity: item.quantity - 1 }
            : item
        )
      );
    } catch (error) {
      console.error("Error decrementing quantity:", error);
    }
  };

  const handleRemove = async (itemId) => {
    try {
      await axios.delete(
        `http://localhost:8000/medical_store_app/cart/remove/${itemId}`
      );
      setCartItems((prevItems) => prevItems.filter((item) => item.id !== itemId));
    } catch (error) {
      console.error("Error removing item from cart:", error);
    }
  };

  useEffect(() => {
    fetchCartItems();
  }, []);

  if (isLoading) {
    return <p>Loading cart items...</p>;
  }

  return (
    <div style={styles.container}>
      <h1 style={styles.title}>Your Cart</h1>
      {cartItems.length === 0 ? (
        <p style={styles.emptyMessage}>Your cart is empty.</p>
      ) : (
        <div style={styles.cartContainer}>
          {cartItems.map((item) => (
            <div key={item.id} style={styles.cartItem}>
              <h3 style={styles.itemName}>{item.medicine.name}</h3>
              <p style={styles.itemDescription}>{item.medicine.description}</p>
              <p style={styles.itemPrice}>Price: ${item.medicine.price}</p>
              <p style={styles.itemQuantity}>Quantity: {item.quantity}</p>
              <div style={styles.buttons}>
                <button
                  style={styles.incrementButton}
                  onClick={() => handleIncrement(item.id)}
                >
                  +
                </button>
                <button
                  style={styles.decrementButton}
                  onClick={() => handleDecrement(item.id)}
                >
                  -
                </button>
                <button
                  style={styles.removeButton}
                  onClick={() => handleRemove(item.id)}
                >
                  Remove
                </button>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

const styles = {
  container: {
    padding: "80px",
  },
  title: {
    textAlign: "center",
    marginBottom: "20px",
  },
  emptyMessage: {
    textAlign: "center",
    fontSize: "18px",
    color: "#555",
  },
  cartContainer: {
    display: "flex",
    flexDirection: "column",
    gap: "20px",
    justifyContent: "center",
    alignItems: "center",
  },
  cartItem: {
    border: "1px solid #ddd",
    borderRadius: "8px",
    padding: "20px",
    width: "300px",
    textAlign: "center",
    boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)",
    marginBottom: "20px",
  },
  itemName: {
    fontSize: "18px",
    fontWeight: "bold",
  },
  itemDescription: {
    fontSize: "14px",
    color: "#777",
  },
  itemPrice: {
    fontSize: "16px",
    fontWeight: "bold",
    color: "#28a745",
  },
  itemQuantity: {
    fontSize: "16px",
    margin: "10px 0",
  },
  buttons: {
    display: "flex",
    justifyContent: "space-between",
    gap: "10px",
  },
  incrementButton: {
    backgroundColor: "#28a745",
    color: "white",
    padding: "10px",
    border: "none",
    borderRadius: "4px",
    cursor: "pointer",
  },
  decrementButton: {
    backgroundColor: "#007bff",
    color: "white",
    padding: "10px",
    border: "none",
    borderRadius: "4px",
    cursor: "pointer",
  },
  removeButton: {
    backgroundColor: "#dc3545",
    color: "white",
    padding: "10px",
    border: "none",
    borderRadius: "4px",
    cursor: "pointer",
  },
};

export default Cart;
